scripts.draw:
function draw(){

    var initialProps = {
        dims: {
          single: { width: 260, height: 225 },
          double: { width: 540, height: 250}
        },
    };

    // Returns object with properties and methods representing
    // dimensions, scales, axes, etc.
    var werk = werkHelper.build(initialProps);


    var line = d3.line()
        .defined(function(d){ return !isNaN(d.y);})
        .x(function(d) { return werk.scales.x(d.x); })
        .y(function(d) { return werk.scales.y(d.y); });

    var svg = d3.select("#chart")
        .append("svg")
        .style("background-color","transparent")
        .attr("width", werk.dims.svg.width + werk.dims.margins.left + werk.dims.margins.right)
        .attr("height", werk.dims.svg.height + werk.dims.margins.top + werk.dims.margins.bottom)
      .append("g")
        .attr("transform", "translate(" + werk.dims.margins.left + "," + werk.dims.margins.top + ")");

    chartwerk.axes.base.shadedRegions.forEach(function(shade) {
        var rectLeft = werk.scales.x(werk.parsers.base(shade.min));
        var rectRight = werk.scales.x(werk.parsers.base(shade.max));
        var minWidth = 2;
        var width = Math.max(2, rectRight - rectLeft);
        if (rectRight === rectLeft) {
            svg.append('line')
                .attr("class",'solid-line')
                .attr("y1", 0)
                .attr("y2", werk.scales.y.range()[0])
                .attr("x1", rectLeft)
                .attr("x2", rectLeft);
        } else {
            svg.append('rect')
                .attr("class","shaded-area")
                .attr('y', 0)
                .attr('x', rectLeft)
                .attr('width', width)
                .attr('height', werk.scales.y.range()[0]); 
        }
    });

    chartwerk.axes.value.shadedRegions.forEach(function(shade) {
        var rectMin = werk.scales.y(werk.parsers.value(shade.min));
        var rectMax = werk.scales.y(werk.parsers.value(shade.max));
        var height = Math.max(2, rectMin - rectMax);
        if (rectMin === rectMax) {
            svg.append('line')
                .attr("class",'dotted-line')
                .attr("x1", 0)
                .attr("x2", werk.scales.x.range()[1])
                .attr("y1", rectMin)
                .attr("y2", rectMin);
        } else {
            svg.append('rect')
                .attr("class","shaded-area")
                .attr('x', 0)
                .attr('y', rectMax)
                .attr('width', werk.scales.x.range()[1])
                .attr('height', height); 
        }
    });


    svg.append("g")
        .attr("class", "y axis")
        .call(werk.axes.y)
      .append("text")
        .attr("class","label")
        .attr("y", -werk.dims.margins.top + 15)
        .attr("x", -werk.dims.margins.left)
        .style("text-anchor", "start")
        .text(chartwerk.axes.value.label);

    svg.append("g")
        .attr("class", "x axis")
        .attr("transform", "translate(0," + werk.dims.svg.height + ")")
        .call(werk.axes.x);


    var series = svg.selectAll(".series")
        .data(werk.data)
      .enter().append("g")
        .attr("class","series");

    series.append("path")
    		.attr("class","line")
    		.attr("d", function(d){ return line(d.values);})
    		.style("stroke", function(d){ return werk.scales.color(d.name);});

    //A rect to catch mouse movements
    var pointerRect = svg.append("rect")
    	.attr("height", werk.dims.svg.height)
    	.attr("width", werk.dims.svg.width)
    	.style("fill","none")
    	.style("pointer-events", "fill")
        .on("mouseout",  hideTooltip)
        .on("mousemove", showTooltip);



    var tooltip = d3.select("#chart")
      .append("div")
        .attr("class","tooltip")
        .style("position","absolute");
    tooltip
      .append("div")
      .attr("class","value");

    var trackCirc = svg.append("circle")
		.attr("cx",0)
		.attr("cy",0)
		.attr("r",4)
		.style("fill","none")
		.style("stroke-width",2)
		.style("display","none")
        .style("pointer-events", "none");

    function hideTooltip(){
        d3.select(".tooltip")
          .style("opacity", 0);
        trackCirc
          .style("display", "none");
    }

    function showTooltip(){
        var x0 = werk.scales.x.invert(d3.mouse(this)[0]),
    		y0 = werk.scales.y.invert(d3.mouse(this)[1]),

    		//Start dist at a max number so we can check all distances less than
    		dist = werk.dataDims.xMax - werk.dataDims.xMin + werk.dataDims.yMax - werk.dataDims.yMin,
    		nearestX = 0,
    		nearestY = 0,
    		colorGroup = "",
    		comma = d3.format(",");

    	werk.data.forEach(function(series){
    		series.values.forEach(function(d){
    			if(Math.abs(x0 - d.x) + Math.abs(y0 - d.y)  < dist){
    				nearestX = d.x
    				nearestY = d.y
    				colorGroup = series.name
    				dist = Math.abs(x0 - d.x) + Math.abs(y0 - d.y)
    			}
    		})

    	});


	    trackCirc
			.attr("cx", werk.scales.x(nearestX))
			.attr("cy", werk.scales.y(nearestY))
			.style("stroke","#333")
			.style("display","");

        d3.select(".tooltip .value")
          .style("color", werk.scales.color(colorGroup))
          .text(function(){
              var v = chartwerk.axes.value;
              return v.prefix + comma(nearestY) + v.suffix;
          });
        var p = d3.mouse(this.parentElement.parentElement);
        d3.select(".tooltip")
            .style("opacity", 1)
            .style("top", function(){
                var s = chartwerk.ui.size,
                    h = werk.dims[s].height,
                    tipH = parseInt(d3.select(".tooltip").style("height"), 10),
                    pos = p[1] > (h / 2) ?
                        p[1] - 60 : p[1] + 20;
                return pos.toString() + "px";
            })
            .style("left", function(){
                // We position either left or right of the mouse point based
                // on whether we're past the midpoint of the chart. This protects
                // against tooltips overflowing embedded iframes.
                var s = chartwerk.ui.size,
                    w = werk.dims[s].width,
                    tipW = parseInt(d3.select(".tooltip").style("width"), 10),
                    pos = p[0] > (w / 2) ?
                        p[0] - (tipW + 20) : p[0] + 40;
                return pos.toString() + "px";
            });
    }
}

scripts.helper:
var werkHelper = {
    parse: function(werk){
        werk.parsers = {
          base: d3.timeParse( chartwerk.axes.base.dateFormat ),
          value: function(d){ return d === '' ? NaN : +d; }
        };

        werk.data = chartwerk.axes.color.domain.map(function(category){
            return {
                name: category,
                values: chartwerk.data.map(function(d){
                    return {
                        x: werk.parsers.base(
                            String(d[chartwerk.datamap.base])
                        ),
                        y: werk.parsers.value(d[category])
                    };
                })
                .sort(function(a, b){ return d3.ascending(a.x, b.x); })
            };
        });

        // Get max and min of data 
        var xMax = d3.max(werk.data,function(series){return d3.max(series.values,function(d){return d.x; }); }),
	        xMin = d3.min(werk.data,function(series){return d3.min(series.values,function(d){return d.x; }); }),
	        yMax = d3.max(werk.data,function(series){return d3.max(series.values,function(d){return d.y; }); }),
	        yMin = d3.min(werk.data,function(series){return d3.min(series.values,function(d){return d.y; }); });

        werk.dataDims = {
            xMin: xMin,
            xMax: xMax,
            yMin: yMin,
            yMax: yMax
        };
    },

    dims: function(werk){
        var s = chartwerk.ui.size;
            w = werk.dims[s].width,
            h = werk.dims[s].height,
            margins = {
                right: chartwerk.margins[s].right * w,
                left: chartwerk.margins[s].left * w,
                top: chartwerk.margins[s].top * h,
                bottom: chartwerk.margins[s].bottom * h
            },
            svg = {
                width: w - margins.left - margins.right,
                height: h - margins.top - margins.bottom
            };

        werk.dims.margins = margins;
        werk.dims.svg = svg;
    },

    scales: function(werk){
        var svg = werk.dims.svg;
        werk.scales = {
            x: d3.scaleTime()
                .range([0, svg.width]),
            y: d3.scaleLinear()
                .range([svg.height, 0]),
            color: chartwerk.axes.color.range.length > 1 ? 
                d3.scaleOrdinal()
                  .domain(chartwerk.axes.color.domain)
                  .range(chartwerk.axes.color.range) 
            :   function(d){return chartwerk.axes.color.range[0];},
        };
    },

    baseDomain:  function(werk){
        var xMax = d3.max(werk.data, function(category) {
                return d3.max(category.values, function(d){
                    return d.x; 
                }); 
            }),
            xMin = d3.min(werk.data, function(category) { 
                return d3.min(category.values, function(d){ 
                    return d.x;
                });
            });
        werk.scales.x.domain([xMin, xMax]);
    },

    valueDomain: function(werk){
        var yMax = d3.max(werk.data, function(category) { 
                return d3.max(category.values, function(d){ 
                    return d.y; 
                }); 
            }),
            yMin = d3.min(werk.data, function(category) {
                return d3.min(category.values, function(d){ 
                    return d.y; 
                }); 
            });

        if (chartwerk.axes.value.min && chartwerk.axes.value.max) {
            werk.scales.y.domain(
                [chartwerk.axes.value.min, chartwerk.axes.value.max]
            );
        } else if (chartwerk.axes.value.min) {
            werk.scales.y.domain(
                [chartwerk.axes.value.min, yMax ]
            );
        } else if (chartwerk.axes.value.max) {
            werk.scales.y.domain(
                [yMin, chartwerk.axes.value.max]
            );
        } else {
            werk.scales.y.domain([yMin, yMax]);
        }

        werk.scales.y.nice();
    },

    axes: function(werk){
        werk.axes = {
          x: d3.axisBottom(werk.scales.x)
              .tickSizeInner(6)
              .tickSizeOuter(0)
              .tickPadding(3),
          y: d3.axisLeft(werk.scales.y)
              .tickSizeInner(-werk.dims.svg.width)
              .tickSizeOuter(0)
              .tickPadding(7)
              .tickFormat( function(d){ 
                var formatter = werk.scales.y.tickFormat();
                if (d >= 0) {
                  return formatter(d) === '0' ? '0' : 
                  chartwerk.axes.value.prefix + formatter(d) + chartwerk.axes.value.suffix;
                } else {
                  return "-" + chartwerk.axes.value.prefix + formatter(Math.abs(d)) + chartwerk.axes.value.suffix;
                }
              }),
        };
    },

    baseTicks: function(werk){
        if (chartwerk.axes.base.type !== 'date') {
            return;
        }

        // Abstract this to a separate file once formats settled.
        var customLocale = {
          "dateTime": "%x, %X",
          "date": "%-m/%-d/%Y",
          "time": "%-I:%M:%S %p",
          "periods": ["AM", "PM"],
          "days": ["Sunday", "Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday"],
          "shortDays": ["S", "M", "T", "W", "T", "F", "S"],
          "months": ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"],
          "shortMonths": ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sep", "Oct", "Nov", "Dec"]
        }

        d3.timeFormatDefaultLocale(customLocale);


        var formatMillisecond = d3.timeFormat(".%L"),
            formatSecond = d3.timeFormat(":%S"),
            formatMinute = d3.timeFormat("%I:%M"),
            formatHour = d3.timeFormat("%I %p"),
            formatDay = d3.timeFormat("%a %d"),
            formatWeek = d3.timeFormat("%b %d"),
            formatMonth = d3.timeFormat("%B"),
            formatYear = d3.timeFormat("%Y");


        var s = chartwerk.ui.size;
        var dateTick;
        switch(chartwerk.axes.base.format[s].dateString) {
            case 'Y':
                dateTick = d3.timeYear;
                formatYear = d3.timeFormat("%Y");
                break;
            case 'y':
                dateTick = d3.timeYear;
                formatYear = d3.timeFormat("'%y");
                break;
            case 'M':
                dateTick = d3.timeMonth;
                formatMonth = d3.timeFormat("%B");
                formatYear = d3.timeFormat("Jan. '%y");
                break;
            case 'm':
                dateTick = d3.timeMonth;
                formatMonth = d3.timeFormat("%b.");
                formatYear = d3.timeFormat("J/%y");
                break;
            case 'W':
            case 'w':
                dateTick = d3.timeWeek;
                formatMonth = d3.timeFormat("%b.");
                formatYear = d3.timeFormat("J/%y");
                break;
            case 'D':
                dateTick = d3.timeDay;
                formatMonth = d3.timeFormat("%b.");
                formatYear = d3.timeFormat("J/%y");
        }

        function multiFormat(date) {
          return (d3.timeSecond(date) < date ? formatMillisecond
              : d3.timeMinute(date) < date ? formatSecond
              : d3.timeHour(date) < date ? formatMinute
              : d3.timeDay(date) < date ? formatHour
              : d3.timeMonth(date) < date ? (d3.timeWeek(date) < date ? formatDay : formatWeek)
              : d3.timeYear(date) < date ? formatMonth
              : formatYear)(date);
        }

        werk.axes.x.tickFormat(multiFormat)

        werk.axes.x.ticks(
            dateTick.every( chartwerk.axes.base.format[s].frequency )
        );
    },

    valueTicks: function(werk){
        var s = chartwerk.ui.size;
        if (chartwerk.axes.value.format[s].customTicks.length > 0) { 
            werk.axes.y.tickValues(
                chartwerk.axes.value.format[s].customTicks
            );
        } else {
            werk.axes.y.ticks(
              chartwerk.axes.value.format[s].ticks
            );
        }
    },

    // Build dims, scales and axes.
    build: function(werk){
        this.parse(werk);
        this.dims(werk);
        this.scales(werk);
        this.baseDomain(werk);
        this.valueDomain(werk);
        this.axes(werk);
        this.baseTicks(werk);
        this.valueTicks(werk);
        return werk;
    },
};

scripts.styles:
#chartwerk {
    font-family:'Gotham A', 'Gotham B', arial, sans-serif; 
    width:560px;
}
#chartwerk.single{
    width:270px;
    float:left;
    overflow:hidden;
    margin:10px 30px 10px 0;
}
#chartwerk #headline { 
    font-weight:bold;
    font-size:24px;
}
#chartwerk #chatter {
    margin-top:5px;
}
#chartwerk #footnote,
#chartwerk #source,
#chartwerk #author {
    font-size:11px;
    color:grey;

}
#chartwerk #author {
    text-align:right;
}
#chartwerk #chart{
    background-color:white;
}
#chartwerk #chart-legend 
.chart-legend-container .key-label{
    font:11px 'Gotham A', 'Gotham B', arial, sans-serif;
}
#chartwerk #chart-legend 
.chart-legend-container .key-color{
    margin-right:2px;
}
#chartwerk #chart-legend 
.chart-legend-container .key{
    margin-right:8px;
}
#chartwerk .annotation p{
    font-family:'Gotham A', 'Gotham B', arial, sans-serif;
}
#chartwerk #chart .tooltip{
    font: 13px 'Gotham A', 'Gotham B', arial, sans-serif;
    opacity:0;
    pointer-events:none;
    background:rgba(255,255,255,.75);
    padding:5px;
    width:auto;
}
#chartwerk #chart .tooltip .value{
    font-weight: bold;
}

#chartwerk #chart path.line{
    fill: none;
    stroke-width: 2px;
}

.axis path,
.axis line {
  fill: none;
  stroke: rgb(180,180,180);
  shape-rendering: crispEdges;
}
.axis text{
    font-family: 'Gotham A', 'Gotham B', 'Montserrat', arial, sans-serif;
    fill: rgb(132,132,132);
    font-size:11px;
}
.y.axis line{
    stroke-dasharray: 3px 3px;
}
.y.axis path{
    display:none;
}
.y.axis .label{
    font-family: 'Gotham A', 'Gotham B', 'Montserrat', arial, sans-serif;
    font-weight:normal;
}
line.dotted-line{
    stroke:rgb(33,33,33);
    stroke-width:1px;
    stroke-dasharray: 7px 5px;
}
line.solid-line{
    stroke:rgb(33,33,33);
    stroke-width:1px;
}
rect.shaded-area{
    fill:#ddd;
}
